import styled from "styled-components";
import { COLORS } from "../../constants";

const Wrapper = styled.article`
  background-color: ${COLORS.primary.cardBgc};
  width: 350px;
`;

const ImageWrapper = styled.div`
  background-color: ${COLORS.primary.softFiolet};
`;

const Img = styled.img`
  opacity: 0.4;
`;

const Title = styled.h2`
  color: white;
`;



function Card() {
  return (
    <Wrapper>
      <ImageWrapper>
        <Img src="images/mobile.jpg" alt="backgrund images card" />
      </ImageWrapper>

      <Title>Get insights that help your business grow</Title>
    </Wrapper>
  )
};

export default Card;
